import {StyleSheet, Text, View} from 'react-native';
import SearchBox from './SearchBox';

const DessertsList = () => {
  return (
    <View>
      <SearchBox />
    </View>
  );
};

const styles = StyleSheet.create({
  welcomeView: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  welcomeText: {
    fontSize: 32,
  },
});
export default DessertsList;
